import { Card, Typography, TextField, Button } from "@material-ui/core"
import { useState } from 'react'
import useStyles from './styles'
import { useDispatch } from 'react-redux'
import { addEmployee } from '../../actions/employees'

const EmployeeForm = () => {
    const classes = useStyles()
    const dispatch = useDispatch()
    const [employee, setEmployee] = useState({
        firstName: '',
        middleInitial: '',
        lastName: '',
        phoneNumber: '',
        email: '',
        position: '',
    }) 

    const handleSubmit = (e) => {
        e.preventDefault()

        dispatch(addEmployee(employee))
    }

    const clear = () => {
        setEmployee({firstName: '', middleInitial: '', lastName: '', phoneNumber: '', email: '', position: '',})
    }


    return (
        <Card >
            <form className={`${classes.root} ${classes.form}`} autoComplete="off" noValidate onSubmit={handleSubmit} >
                {/* <Typography variant="h6">{currentId ? 'Editing' : 'Creating'} a Memory</Typography> */}
                <TextField name="firstName" variant="outlined" label="First Name" fullWidth value={employee.firstName} onChange={ (e) => setEmployee({ ...employee, firstName: e.target.value }) } />
                <TextField name="middleInitial" variant="outlined" label="Middle Initial" fullWidth value={employee.middleInitial} onChange={ (e) => setEmployee({ ...employee, middleInitial: e.target.value }) } />
                <TextField name="lastName" variant="outlined" label="Last Name" fullWidth value={employee.lastName} onChange={ (e) => setEmployee({ ...employee, lastName: e.target.value}) } />
                <TextField name="phoneNumber" variant="outlined" label="Phone Number" fullWidth value={employee.phoneNumber} onChange={ (e) => setEmployee({ ...employee, phoneNumber: e.target.value }) } />
                <TextField name="email" variant="outlined" label="Email" fullWidth value={employee.email} onChange={ (e) => setEmployee({...employee, email: e.target.value}) } />
                <TextField name="position" variant="outlined" label="Position" fullWidth value={employee.position} onChange={ (e) => setEmployee({...employee, position: e.target.value}) } />
                {/* <div className={classes.fileInput}><FileBase type="file" multiple={false} onDone={({base64}) => setEmployee({ ...employee, selectedFile: base64 })} /></div> */}
                <Button className={classes.buttonSubmit} variant="contained" color="primary" size="large" type="submit" fullWidth>Submit</Button>
                {/* <Button variant="contained" color="secondary" size="small" onClick={clear} fullWidth>Clear</Button> */}
            </form>
        </Card>
    )
}

export default EmployeeForm
